import 'package:equatable/equatable.dart';import 'package:flutter/material.dart';@immutableclass ProfileMd extends Equatable {  final int profileId;  final String userId;  final String? totalSpent;  final String? totalOrders;  final DateTime? lastOrderDate;  const ProfileMd({    required this.profileId,    required this.userId,    this.totalSpent,    this.totalOrders,    this.lastOrderDate,  });  @override  List<Object?> get props => [        profileId,        userId,        totalSpent,        totalOrders,        lastOrderDate,      ];  factory ProfileMd.fromJson(Map<String, dynamic> json) {    try {      return ProfileMd(        profileId: json['profile_id'],        userId: json['user_id'],        totalSpent: json['total_spent'],        totalOrders: json['total_orders'],        lastOrderDate: json['last_order_date'] == null            ? null            : DateTime.parse(json['last_order_date']),      );    } on TypeError catch (e, st) {      debugPrint("Error: $e, $st");      rethrow;    }  }  Map<String, dynamic> toJson() {    return {      'profile_id': profileId,      'user_id': userId,      'total_spent': totalSpent,      'total_orders': totalOrders,      'last_order_date': lastOrderDate?.toIso8601String(),    };  }}